import { getProductById } from "../lib/axios";

const Home = () => {
  return (
    <div>
      <h1>Home</h1>
      {/* Feature 3 items here */}
      <div>Item 1</div>
      <div>Item 2</div>
      <div>Item 3</div>
      {/* Branding */}
      <div>Banner</div>
      <button onClick={() => console.log("checkout clicked")}>Checkout</button>
      {/* Filtered Category Products*/}
    </div>
  );
};

export default Home;
